                   <input className="form-control" type="email" placeholder="Email" name ="email" />
                   <textarea className="form-control" type= "text" placeholder="Comment" name="comment"></textarea>
               </div>
                
                
        </div>
           

       </div>
   </div>
   </div>
  );
